import Paper from '@mui/material/Paper';


function StartPage() {
    return (
        /*<div className="parent">
            <div className="child">
                <Link to={"/Survey"}>
                    <Button className="startBt" variant="contained" color="babyblue">시작하기</Button>
                </Link>
            </div>
        </div>*/
        <div className="parent">
            <Box
                sx={{
                    display: 'flex',
                    flexWrap: 'wrap',
                    '& > :not(style)': {
                        m: 10,
                        width: 128,
                        height: 128,
                    },
                }}
            >
                <Paper elevation={3} />
            </Box>
        </div>
    )

}
export default StartPage;
